import React, { useEffect, useState } from 'react'
import api from '../services/api'

export default function VehiclePanel({ vehicles = [], selectedLocation, onRefresh, onStartAssign, onCreated }){
  const [list, setList] = useState([])
  const [form, setForm] = useState({ name: '', location: { x: 0, y: 0 } })
  const [editingId, setEditingId] = useState(null)
  const [nameError, setNameError] = useState('')

  useEffect(()=> setList(vehicles), [vehicles])

  // If the user has clicked on the map while assigning, update the form location
  useEffect(()=>{
    if(selectedLocation){
      setForm(f => ({...f, location: selectedLocation }))
    }
  },[selectedLocation])

  const create = async ()=>{
    if(!form.name || !form.name.trim()){
      setNameError('Vehicle name is required')
      return
    }
    try{ await api.createVehicle(form); setForm({name:'', location:{x:0,y:0}}); setNameError(''); onRefresh && onRefresh(); onCreated && onCreated() }catch(e){ console.error(e) }
  }

  const remove = async (id)=>{ try{ await api.deleteVehicle(id); onRefresh && onRefresh() }catch(e){ console.error(e) } }

  const startEdit = (veh)=> { setEditingId(veh.id); setForm({ name: veh.name, location: veh.location }) }

  const saveEdit = async (id)=>{
    if(!form.name || !form.name.trim()){
      setNameError('Vehicle name is required')
      return
    }
    try{ await api.updateVehicle(id, form); setEditingId(null); setNameError(''); onRefresh && onRefresh() }catch(e){ console.error(e) }
  }

  return (
    <div className="panel">
      <h3>Vehicles</h3>
      <div style={{marginBottom:8}} className="form-row">
        <div className="form-field">
          <input className={`${'form-input'} ${nameError? 'invalid-input' : ''}`} placeholder="Name" value={form.name} onChange={e=>{ setForm({...form, name:e.target.value}); if(nameError) setNameError('') }} />
          {nameError && <div className="error-text">{nameError}</div>}
        </div>

        <span className="coords-box">x: {form.location.x} y: {form.location.y}</span>

        <div className="btn-row" style={{marginLeft:'auto'}}>
          <button className="btn" onClick={onStartAssign}>Assign from map</button>
          <button className="btn primary" onClick={create} disabled={!form.name || !form.name.trim()}>Create</button>
        </div>
      </div>

      <div>
        {list.map((veh) => (
          <div key={veh.id} className="item-row">
            {editingId === veh.id ? (
              <>
                <div style={{display:'flex', alignItems:'center', gap:8, width:'100%'}}>
                  <div className="form-field">
                    <input className={`${'form-input'} ${nameError? 'invalid-input' : ''}`} value={form.name} onChange={e=>{ setForm({...form, name: e.target.value}); if(nameError) setNameError('') }} />
                    {nameError && <div className="error-text">{nameError}</div>}
                  </div>
                  <span className="coords-box">x: {form.location.x} y: {form.location.y}</span>
                  <div className="btn-row" style={{marginLeft:'auto'}}>
                    <button className="btn" onClick={onStartAssign}>Assign from map</button>
                    <button className="btn primary" onClick={()=>saveEdit(veh.id)} disabled={!form.name || !form.name.trim()}>Save</button>
                    <button className="btn" onClick={()=>setEditingId(null)}>Cancel</button>
                  </div>
                </div>
              </>
            ) : (
              <>
                <div style={{flex:1}}>
                  <strong>{veh.name}</strong>
                  <div className="coords-box">x: {veh.location?.x} y: {veh.location?.y}</div>
                </div>
                <button className="btn" onClick={()=>startEdit(veh)}>Edit</button>
                <button className="btn danger" onClick={()=>remove(veh.id)}>Delete</button>
              </>
            )}
          </div>
        ))}
      </div>
    </div>
  )
}
